import React from 'react';
import './Footer.css';
import logo from '../HeaderComponent/Logo_1.png';

const Footer = () => {
  return (
    <footer className="bg-dark text-light py-4">
      <div className="container d-flex justify-content-between align-items-center">
        <div className="footer-logo">
          <img src={logo} alt="Company Logo" className="img-fluid" />
          <p className="mt-2"></p>
        </div>
        <div className="social-icons">
          <a className='social-link' href="https://www.youtube.com">
            <img src="youtube_icon.png" alt="YouTube" className="social-icon" />
          </a>
          <a className='social-link' href="https://www.twitter.com">
            <img src="twitter_icon.png" alt="Twitter" className="social-icon" />
          </a>
          {/* Add other social media icons */}
        </div>
      </div>
      <div className="text-center mt-3">
        &copy; {new Date().getFullYear()} DealPaka. All rights reserved.
      </div>
    </footer>
  );
};

export default Footer;
